(98, 4, 19, '3', 17, 'pengetahuan', '3.20 Menganalisis fungsi sosial, struktur teks, dan unsur kebahasaan untuk menyatakan dan menanyakan tentang pengandaian suatu keadaan/ kejadian/peristiwa di waktu yang akan datang, sesuai dengan konteks penggunaannya', 75, '75,75,75', 'Menganalisis fungsi sosial, struktur teks, dan unsur kebahasaan untuk menyatakan dan menanyakan tentang pengandaian suatu keadaan/ kejadian/peristiwa di waktu yang akan datang, sesuai dengan konteks penggunaannya\r\n\r\n', '2019-01-31 09:39:05', 'Ya'),
