(102, 4, 19, '3', 17, 'pengetahuan', '3.21 	 Menganalisis struktur teks dan unsur kebahasaan untuk melaksanakan fungsi sosial teks faktual report dengan menyatakan dan menanyakan tentang teks ilmiah faktual tentang orang, binatang, benda, gejala dan peristiwa alam dan sosial, sederhana, sesuai dengan konteks pembelajaran di pelajaran lain', 75, '75,75,75', '3.21.1 \r\nMengidentifikasi  fungsi sosial, struktur teks dan unsur kebahasaan dalamteks ilmiah faktualsesuai dengan konteks penggunaannya.\r\n3.21.2 \r\nMembedakan  fungsi sosial, struktur teks dan unsur kebahasaan dari berbagai teks ilmiah faktual sesuai dengan konteks penggunaannya', '2019-01-31 09:46:46', 'Ya'),
(103, 4, 19, '4', 212, 'keterampilan', '4.21  Menyusun teks ilmiah faktual (factual report), lisan dan tulis, sederhana, tentang orang, binatang, benda, gejala dan peristiwa alam dan sosial, terkait dengan mata pelajaran lain', 75, '75,75,75', '4.21.1 \r\nMenyusun teks ilmiah faktualdengan menggunakan struktur teks dan unsur kebahasaan yang tepat sesuai dengan konteks penggunaannya.\r\n\r\n4.21.2 \r\nMengkomunikasikan secara lisan dan tertulis tentang teks ilmiah faktual dengan menggunakan struktur teks dan unsur kebahasaan yang tepat sesuai dengan konteks penggunaannya\r\n', '2019-01-31 09:48:00', 'Ya'),
(104, 4, 19, '3', 17, 'pengetahuan', '3.22 Menganalisis fungsi sosial, struktur teks, dan unsur kebahasaan beberapa teks eksposisi analitis lisan dan tulis dengan memberi dan meminta informasi terkait isu aktual, sesuai dengan konteks penggunaannya', 75, '75,75,75', '3.22.1 \r\nMengidentifikasi  fungsi sosial, struktur teks dan unsur kebahasaan dalam teks eksposisi analitis sesuai dengan konteks penggunaannya\r\n3.22.2 \r\nMembedakan  fungsi sosial, struktur teks dan unsur bahasa dari berbagai teks eksposisi analitis sesuai dengan konteks penggunaannya\r\n', '2019-01-31 09:49:46', 'Ya'),
(105, 4, 19, '4', 212, 'keterampilan', '4.22  Menyusun teks eksposisi analitis tulis, terkait isu aktual, dengan memperhatikan fungsi sosial, struktur teks, dan unsur kebahasaan, secara benar dan sesuai konteks', 75, '75,75,75', '4.22.1 \r\nMenyusun teks eksposisi analitis dengan menggunakan struktur teks dan unsur kebahasaan yang tepat sesuai dengan konteks penggunaannya.\r\n4.22.2 \r\nMengkomunikasikan secara lisan dan tertulis teks eksposisi analitis dengan menggunakan struktur teks dan unsur kebahasaan yang tepat sesuai dengan konteks penggunaan\r\n', '2019-01-31 09:51:09', 'Ya'),
(109, 4, 19, '3', 17, 'pengetahuan', '3.23	 Menganalisis fungsi social, struktur teks dan unsur kebahasaan pada teks biografi tokoh sesuai dengan konteks penggunaannya.', 75, '75,75,75', '3.23.1 \r\nMengidentifikasi  fungsi sosial, struktur teks dan unsur kebahasaan dalam teks biografi tokohsesuai dengan konteks penggunaannya.\r\n3.23.2 \r\nMembedakan  fungsi sosial, struktur teks dan unsur bahasa dari berbagai ungkapan dalam teks biografi tokoh sesuai dengan konteks penggunaannya.\r\n', '2019-01-31 09:59:25', 'Ya'),
(108, 4, 19, '4', 212, 'keterampilan', '4.23  Menyusun teks biografi tokoh lisan dan tulis, pendek dan sederhana, dengan memperhatikan fungsi sosial, struktur teks, dan unsur kebahasaan yang benar dan sesuai konteks', 75, '75,75,75', '4.23.1 \r\nMenyusun teks mengenai teks biografi tokoh dengan menggunakan struktur teks dan unsur kebahasaan yang tepat sesuaisesuai dengan konteks penggunaannya.\r\n\r\n\r\n\r\n4.23.2 \r\nMengkomunikasikan secara lisan dan tertulis tentang teks biografi tokohdengan menggunakan struktur teks dan unsur kebahasaan yang tepat sesuai dengan konteks penggunaan\r\n', '2019-01-31 09:56:10', 'Ya'),
