(187, 4, 35, '3.32', 86, 'pengetahuan', 'Menganalisis  informasi terkait pengandaian diikuti oleh perintah/saran sesuai dengan bidang keahlian dan konteks penggunaannya. ', 75, '75,75,75', '3.32.1 Mengidentifikasi  fungsi sosial, struktur teks dan unsur kebahasaan dalam teks mengenai pengandaian diikuti oleh perintah/saransesuai dengan konteks penggunaannya.\r\n3.32.2 Membedakan  fungsi sosial, struktur teks dan unsur kebahasaan dari berbagai ungkapan mengenai pengandaian diikuti oleh perintah/saran sesuai dengan konteks penggunaannya.\r\n\r\n4.32.1 Menyusun teks lisan dan tulis mengenai pengandaian diikuti oleh perintah/saransesuai dengan konteks penggunaannya.\r\n4.32.2 Mengkomunikasikan secara lisan dan tulis ungkapan tentang pengandaian diikuti oleh perintah/sarandengan menggunakan struktur teks dan unsur kebahasaan yang tepat sesuai dengan konteks penggunaan', '2019-03-01 12:03:14', 'Ya'),
(186, 4, 35, '3.31', 86, 'pengetahuan', 'Menganalisis  teks news item dengan memberi dan meminta informasi terkait berita sederhana dari koran/radio/TV', 75, '75,75,75', '3.31.1 Mengidentifikasi  fungsi sosial, struktur teks dan unsur kebahasaan dalam teks beritasesuai dengan konteks penggunaannya.\r\n3.31.2 Membedakan  fungsi sosial, struktur teks dan unsur bahasa dari berbagai ungkapan dalamteks berita sesuai dengan konteks penggunaannya.\r\n4.31.1 Menyusun teks lisan dan tertulis mengenai suatu beritasesuai dengan konteks penggunaannya.\r\n4.31.2 Mengkomunikasikan secara lisan dan tertulis tentang teks beritadengan menggunakan struktur teks dan unsur kebahasaan yang tepat sesuai dengan konteks penggunaan\r\n', '2019-03-01 11:48:43', 'Ya'),
(264, 4, 17, '20190', 117, 'sosial', 'memahami karya ilmiah', 75, '75,75,75', 'peserta didik dapat memahami pengertian karya ilmiah\r\npeserta didik dapat menentukan jenis-jenis karya ilmiah\r\npeserta didik dapat menentukan struktur karya ilmiah \r\npeserta didik dapat menentukan informasi penting yang terdapat didalam karya ilmiah (artikel, makalah dan skripsi)', '2019-03-10 10:23:36', 'Ya'),
(262, 4, 32, '4', 114, 'keterampilan', '3.4 Mengevaluasi dinamika persatuan dan kesatuan bangsa sebagai upaya menjaga dan mempertahankan Negara Kesatuan Republik Indonesia.', 75, '75,75,75', '3.4.1 Menganalisis konsep negara kesatuan.\r\n3.4.2 Menganalisis karakteristik Negara Kesatuan Republik Indonesia.\r\n3.4.3 Mengidentifi kasi kelebihan konsep Negara Kesatuan.\r\n3.4.4 Menilai persatuan dan kesatuan bangsa pada masa Revolusi Kemerdekaan (18 Agustus 1945 sampai dengan 27 Desember 1949).\r\n3.4.5 Menilai persatuan dan kesatuan bangsa pada masa Republik Indonesia Serikat (27 Desember 1949 sampai dengan 17 Agustus 1950).\r\n3.4.6 Menilai persatuan dan kesatuan pada masa Demokrasi Liberal (17 Agustus 1950 sampai dengan 5 Juli 1959).\r\n3.4.7 Menilai persatuan dan kesatuan bangsa pada masa Orde Lama (5Juli 1959 sampai dengan 11 Maret 1966).', '2019-03-08 11:07:21', 'Ya'),
(188, 4, 36, '3.14', 88, 'pengetahuan', 'Menerapkan hukum-hukum kemagnetan  dalam persoalan sehari-hari', 75, '75,75,75', '1.Perpindahan muatan menimbulkan medan magnet  disekitar kawat ber arus listrik sesuai dengan percobaan Oersted\r\n2.Menerapkan konsep-konsep gaya Lorentz diberbagai peralatan teknologi\r\n3.Mengidentifikasikan bahan-bahan sesuai dengan sifat kemagnetan ', '2019-03-01 14:45:57', 'Ya'),
(205, 4, 21, '4.9', 95, 'keterampilan', 'menyajikan penggunaan gelombang dalam teknologi ', 75, '75,75,75', '1.  menghitung percepatan grafitasi bumi disuatu tempat dengan percobaan sederhana menerapkan konsep ayunan sederhana\r\n  ( pendulum )\r\n2.  menganalisis gambar gelombang transversal dalam  perhitungan besaran fisika seperti menghitung panjang gelombang, cepat rambat gelombang, bilangan gelombang dll )\r\n2. mengunakan konsep gelombang elektromagnetik dalam teknologi dan rekayasa\r\n3. memanfaatkan  sifat umum gelombang untuk teknologi dan rekayasa\r\n4.  merekayasa sumber sumber bunyi\r\n5.  mengaplikasikan konsep bunyi dalam dunia teknologi dan rekayasa', '2019-03-04 10:00:39', 'Ya'),
(191, 4, 21, '3.9', 90, 'pengetahuan', 'Menganalisis getaran,  gelombang dan bunyi', 75, '75,75,75', '1. memahami pengertian gelombang beserta besaran besarannya\r\n2. menganalisis konsep getaran harmonis pada ayunan sederhana\r\n3. menganalisis konsep getaran selaras pada getaran pegas\r\n4. menggunakan persamaan persamaan getaran selaras dalam perhitungan \r\n5. memahami konsep gelombang serta kaitannya dengan getaran\r\n6. mengenal pembagian gelombang berdasarkan bentuknya, \r\n7. mengenal pembagian gelombang berdasarkan cara perpindahan energinya.\r\n8. mengenal pembagian gelombang berdasarkan amplitudonya\r\n9. persamaan gelombang berjalan meliputi  semua besaran yang ada pada gelombang \r\n10. memahami konsep gelombang elektromagnetik\r\n11.  menganalisis sifat sifat umum gelombang \r\n12    menganalisis konsep bunyi\r\n13.   menganalisis sifat sifat khusus gelombang bunyi\r\n14.   mengenal teknologi  dan rekayasa  sumber sumber bunyi\r\n15.    menganalisis konsep resonansi bunyi', '2019-03-01 15:44:28', 'Ya'),
