(198, 4, 42, '3.4', 71, 'pengetahuan', 'Menerapkan installasi sistem kontrol dengan Programmable Logic Controller (PLC).', 75, '75,75,75', '3.4.1 Mengidentifikasi peralatan yang digunakan pada installasi sistem kontrol\r\n3.4.2 Menjelaskan installasi sistem kontrol dengan Programmable Logic Controller (PLC).\r\n3.4.3 Menentukan installasi sistem kontrol dengan Programmable Logic Controller (PLC).\r\n', '2019-03-03 18:09:50', 'Ya'),
