(200, 4, 42, '3.6', 71, 'pengetahuan', 'Menganalisis gangguan sistem kendali PLC.', 75, '75,75,75', '3.6.1 Menjelaskan tentang sistem kendali PLC.\r\n3.6.2 Menjelaskan gangguan sistem kendali PLC.\r\n3.6.3 Mencontohkan gangguan sistem kendali PLC.\r\n3.6.4 Menguji gangguan sistem kendali PLC\r\n', '2019-03-03 18:11:09', 'Ya'),
