(202, 4, 42, '4.5', 93, 'keterampilan', 'Merakit sirkit kontrol berbasis perangkat PLC', 75, '75,75,75', '4.5.1 Melakukan perakitan sirkit kontrol berbasis perangkat PLC.\r\n4.5.2 Mencoba sirkit kontrol berbasis perangkat PLC.\r\n4.5.3 Menampilkan sirkit kontrol berbasis perangkat PLC.', '2019-03-03 18:13:44', 'Ya'),
