(203, 4, 42, '4.6', 93, 'keterampilan', 'Melacak gangguan sistem kendali PLC', 75, '75,75,75', '4.6.1 Menampilkan gangguan sistem kendali PLC.\r\n4.6.2 Memperbaiki gangguan sistem kendali PLC.\r\n4.6.3 Menyajian gangguan sistem kendali PLC\r\n', '2019-03-03 18:14:23', 'Ya'),
(204, 4, 32, '3', 94, 'pengetahuan', '3.3 Mengidentifi kasi pengaruh kemajuan ilmu pengetahuan dan teknologi terhadap negara dalam bingkai BhinnekaTunggal Ika', 75, '75,75,75', '3.3.1 Mengidentifi kasi pengaruh positif kemajuan iptek dalam aspek politik.\r\n3.3.2 Mengidentifi kasi pengaruh positif kemajuan iptek dalam aspek ekonomi.\r\n3.3.3 Mengidentifi kasi pengaruh positif kemajuan iptek dalam aspek sosial budaya.\r\n3.3.4 Mengidentifi kasi pengaruh positif kemajuan iptek dalam pertahanan keamanan.\r\n3.3.5 Mengidentifi kasi pengaruh negatif kemajuan iptek dalam aspek politik.\r\n3.3.6 Mengidentifi kasi pengaruh negatif kemajuan iptek dalam aspek ekonomi.\r\n3.3.7 Mengidentifi kasi pengaruh negatif kemajuan iptek dalam aspek sosial budaya.\r\n3.3.8 Mengidentifi kasi pengaruh negatif kemajuan iptek dalam pertahanan keamanan.\r\n3.3.9 Memilih strategi mengatasi berbagai pengaruh negatif kemajuan iptek.\r\n3.3.10 Mengidentifi kasi sikap selektif dalam menghadapi berbagai pengaruh kemajuan iptek.', '2019-03-04 07:55:29', 'Ya'),
(206, 4, 34, '3.30', 96, 'pengetahuan', 'Menentukan nilai limit fungsi aljabar, turunan serta penerapannya, turunan pertama suatu fungsi ', 75, '75,75,75', '3.30.1.  Menjelaskan dan menentukan nilai limit fungsi aljabar pada masalah kontekstual\r\n3.30.2.  Menjelaskan dan menentukan turunan pertama pada masalah kontekstual\r\n', '2019-03-04 15:08:08', 'Ya'),
