(222, 4, 10, '4.6', 103, 'keterampilan', 'melakukan percobaan sederhana tentang momentum sudut dan rotasi benda tegar', 75, '75,75,75', '1. memperagakan gerak translasi dan rotasi serta menjelaskan analoginya\r\n2. mempraktikkan cara menetukan letak titik berat benda yang berbentuk teratur dan benda yang berbentuk tidak teratur\r\n3. memperagakan kondisi benda yang seimbang secara translasi dan seimbang secara rotaso', '2019-03-05 10:55:11', 'Ya'),
(219, 4, 10, '3.5', 102, 'pengetahuan', 'menerapkann konsep momentum, impuls dan hukum kekekalan momentum', 75, '75,75,75', '1. memahami pengertian momentum\r\n2. memahami pengertian impuls\r\n3. memahami hubungan antara momentum dengan impuls\r\n4. memahami konsep hukum kekekalan momentum\r\n5. memahami konsep bermacam macam tumbukan dalam fisika\r\n6. menerapkan konsep hukum kkekekalan momentum dalam perhitungan', '2019-03-05 09:35:46', 'Ya'),
(220, 4, 10, '4.5', 103, 'keterampilan', 'mendemonstrasikan berbagai jenis tumbukan', 75, '75,75,75', '1. mengenal tumbukan lenting sempurna dan segala konsekwensinya\r\n2. mengenal tumbukan lenting sebagian dan segala konsekwensinya\r\n3. mengenal tumbukan tidak lenting sama sekali dan segala konsekwensinya\r\n4. menentukan data yang diperlukan untuk membuat benda aplikasi prinsip momentun dan impuls\r\n5. menerapkan konsep momentum dan impuls dalam perhitungan', '2019-03-05 09:46:43', 'Ya'),
(209, 4, 34, '3.31', 96, 'pengetahuan', 'Menentukan nilai maksimum, minimum dan selang kemonotonan dan kemiringan garis singgung kurva', 75, '75,75,75', '3.31.1.  Menyelesaikan dan menyajikan nilai fungsi dengan nilai maksimum, nilai minimum,\r\n3.31.2.  Menyelesaikan dan menyajikan selang kemonotonan fungsi, serta kemiringan garis singgung kurva pada masalah kontekstual\r\n', '2019-03-04 15:22:49', 'Ya'),
(210, 4, 35, '3.28', 86, 'pengetahuan', 'Menganalisis surat lamaran kerja dengan memberi dan meminta informasi terkait jati diri, latar belakang pendidikan/pengalaman kerja', 75, '75,75,75', '3.28.1 Menganalisis fungsi sosial, struktur teks, dan unsur kebahasaan dari teks surat lamaran kerja \r\n\r\n3.28.2 Membedakan  fungsi sosial, struktur teks dan unsur bahasa dari berbagai surat lamaran kerja  sesuai dengan konteks penggunaannya.\r\n\r\n4.28.1 Menyunting surat lamaran kerja, dengan memperhatikan fungsi sosial, struktur teks, dan unsur kebahasaan yang tepat dan sesuai konteks. \r\n \r\n4.28.2 Menyusun surat lamaran kerja, dengan memperhatikan fungsi sosial, struktur teks, dan unsur kebahasaan yang tepat dan sesuai konteks\r\n', '2019-03-04 15:30:17', 'Ya'),
(211, 4, 35, '3.29', 86, 'pengetahuan', 'Menganalisis tindakan memberi dan meminta informasi terkait jati diri dalam konteks wawancara pekerjaan', 75, '75,75,75', '3.29.1 Mengidentifikasi  fungsi sosial, struktur teks dan unsur kebahasaan dalam teks mengenai meminta dan memberi informasi terkait jati diri dalam konteks pekerjaan (wawancara pekerjaan) sesuai dengan konteks penggunaannya.\r\n\r\n3.29.2 Membedakan  fungsi sosial, struktur teks dan unsur bahasa dari berbagai ungkapan mengenai meminta dan memberi informasi terkait jati diri dalam konteks pekerjaan (wawancara pekerjaan)  sesuai dengan konteks penggunaannya.\r\n\r\n4.29.1 Menyusun teks lisan dan tertulis mengenai meminta dan memberi informasi terkait jati diri dalam konteks pekerjaan (wawancara pekerjaan) sesuai dengan konteks penggunaannya.\r\n\r\n4.29.2 Mengkomunikasikan secara lisan dan tertulis memberi dan meminta informasi tentang meminta dan memberi informasi terkait jati diri dalam konteks pekerjaan (wawancara pekerjaan)dengan menggunakan struktur teks dan unsur bahasa yang tepat sesuai dengan konteks penggunaan', '2019-03-04 15:32:19', 'Ya'),
(212, 4, 35, '3.30', 86, 'pengetahuan', 'Menganalisis pernyataan tentang keharusan sesuai dengan konteks penggunaannya. ', 75, '75,75,75', '3.30.1 Mengidentifikasi fungsi sosial, struktur teks, dan unsur kebahasaan dari ungkapan tentang keharusan dan responsnya, sesuai dengan konteks penggunaannya.\r\n \r\n3.30.2 Menganalisis fungsi sosial, struktur teks, dan unsur kebahasaan pada ungkapan tentang keharusan dan responsnya sesuai dengan konteks penggunaannya. \r\n\r\n4.30.1. Menyusun teks lisan dan tulis  tentang  ungkapan menanyakan dan menyatakan keharusan\r\n\r\n4.30.2. Mengkomunikasikan teks  tentang menyatakan dan menanyakan keharusan yang berkaitan sesuai dengan konteks penggunaannya.', '2019-03-04 15:34:22', 'Ya'),
