(221, 4, 10, '3.6', 102, 'pengetahuan', 'menerapkan konsep torsi, momen inersia dan momentum sudut pada benda tegar dalam bidang teknologi dan rekayasa', 75, '75,75,75', '1.  mengenal pengertian benda tegar beserta contohnya\r\n2. memahami pengertian gerak translasi dan rotasi \r\n3. memahami analogi  antara gerak translasi dengan rotasi \r\n4. memahami konsep momen inersia berbagai bentuk  benda\r\n5. menghitung momen inersia suatu benda\r\n6. memahami konsep momen gaya ( torsi )\r\n7. menghitung momen gaya yang bekerja pada sebuah benda\r\n8. menghitung energi kinetik gerak translasi dan rotasi\r\n9. menggunakan hukum kekekalan momentum sudut dalam perhitungan \r\n10. memahami konsep titik massa sebuah benda\r\n11. memahami konsep titik berat sebuah benda\r\n12. mengetahui syarat kesetimbangan  benda  berupa titik ( kesetimbangan titik )\r\n13. mengetahui syarat kesetimbangan  benda \r\n14. menggunakan konsep kesetimbangan benda dalam perhitungan\r\n15. mengenal macam macam kondisi kesetimbangan benda ( kesetimbangan stabil, labil dan netral )\r\n', '2019-03-05 10:11:40', 'Ya'),
