(306, 4, 6, '3.11', 120, 'pengetahuan', 'Menganalisis  teks tindakan memberi dan meminta informasi tentang petunjuk arah (direction) sesuai dengan konteks penggunaannya di dunia kerja. ', 75, '75,75,75', '3.11.1 Mengidentifikasi  fungsi sosial, struktur teks dan unsur kebahasaan dalam teks mengenai meminta dan memberi informasi petunjuk arah sesuai dengan konteks penggunaannya.\r\n\r\n3.11.2 Membedakan  fungsi sosial, struktur teks dan unsur kebahasaan dari berbagai ungkapan mengenai meminta dan memberi informasi petunjuk arah sesuai dengan konteks penggunaannya.\r\n', '2019-03-27 11:07:24', 'Ya'),
(307, 4, 6, '4.11', 121, 'keterampilan', 'Menyusun teks memberi dan meminta informasi tentang petunjuk arah (direction) dengan memperhatikan fungsi social, struktur teks dan unsur kebahasaan yang benar dan sesuai konteks di dunia kerja.', 75, '75,75,75', '4.11.1 Menyusun teks lisan dan tertulis mengenai mengenai meminta dan memberi informasi tentang petunjuk arah sesuai dengan konteks penggunaan.\r\n\r\n4.11.2 Mengkomunikasikan secara lisan dan tertulis mengenai mengenai meminta dan memberi informasi tentang petunjuk arah dengan menggunakan struktur teks dan unsur kebahasaan yang tepat sesuai dengan konteks penggunaan\r\n', '2019-03-27 11:09:29', 'Ya'),
