(354, 4, 8, '4', 160, 'keterampilan', '4.1	Mempraktikan teknik dasar salah satu aktifitas olahraga permainan bola besar untuk menghasilkan koordinasi gerak yang baik', 75, '75,75,75', 'â€¢	Melakukan latihan teknik dasar gerakan mengoper, mengontrol, menembak, menggiring bola dengan menggunakan kaki bagian dalam, luar dan punggung kaki serta sikap tubuh pada waktu melakukan latihan teknik tersebut.', '2019-04-01 10:44:38', 'Ya'),
(353, 4, 8, '3', 158, 'pengetahuan', '3.1	Menerapkan teknik dasar salah satu aktifitas olahraga permainan bola besar untuk menghasilkan koordinasi gerak yang baik', 75, '75,75,75', 'â€¢	Menemukan variasi dan kombinasi teknik mengoper, mengontrol, menembak, menggiring bola dengan menggunakan kaki bagian dalam, luar dan punggung kaki serta sikap tubuh pada waktu melakukan latihan teknik tersebut.', '2019-04-01 10:35:17', 'Ya'),
(355, 4, 8, '3', 158, 'pengetahuan', '3.2	Menerapkan teknik dasar salah satu aktifitas olahraga permainan bola kecil untuk menghasilkan koordinasi gerak yang baik', 75, '75,75,75', 'â€¢	Menjelaskan tahapan teknik dasar memukul forehand, memukul backhand, dan servis bulutangkis (berpasangan dan berkelompok) dengan koordinasi yang baik.\r\nâ€¢	Menemukan variasi dan kombinasi teknik dasar memukul forehand, memukul backhand, dan servis bulutangkis (berpasangan dan berkelompok) dengan koordinasi yang baik.\r\n', '2019-04-01 10:50:23', 'Ya'),
(356, 4, 8, '4', 160, 'keterampilan', '4.2	Mempraktikan teknik dasar salah satu aktifitas olahraga permainan bola kecil untuk menghasilkan koordinasi gerak yang baik', 75, '75,75,75', 'â€¢	Melakukan latihan teknik dasar memukul forehand, memukul backhand, dan servis bulutangkis (berpasangan dan berkelompok) dengan koordinasi yang baik.\r\nâ€¢	Melakukan variasi dan teknik dasar memukul forehand, memukul backhand, dan servis bulutangkis (berpasangan dan berkelompok) dengan koordinasi yang baik.\r\n', '2019-04-01 11:35:15', 'Ya'),
(357, 4, 8, '3', 158, 'pengetahuan', '3.3	Menerapkan salah satu keterampilan aktifitas atletik untuk menghasilkan gerak yang efektif ', 75, '75,75,75', 'â€¢	Menjelaskan tahapan teknik dasar lari sprint 100 meter (start, gerakan lari, memasuki garis finish) yang dilakukan (perorangan dan berkelompok) dengan koordinasi yang baik.\r\nâ€¢	Menemukan variasi dan kombinasi teknik dasar lari sprint 100 meter (start, gerakan lari, memasuki garis finish) yang dilakukan (perorangan dan berkelompok) dengan koordinasi yang baik.\r\n', '2019-04-01 11:45:54', 'Ya'),
(358, 4, 8, '4', 160, 'keterampilan', '4.3	Mempraktikkan salah satu keterampilan aktifitas atletik untuk menghasilkan gerak yang efektif ', 75, '75,75,75', 'â€¢	Melakukan latihan teknik dasar lari sprint 100 meter (start, gerakan lari, memasuki garis finish) yang dilakukan (perorangan dan berkelompok) dengan koordinasi yang baik.\r\nâ€¢	Melakukan variasi dan kombinasi teknik dasar lari sprint 100 meter (start, gerakan lari, memasuki garis finish) yang dilakukan (perorangan dan berkelompok) dengan koordinasi yang baik.\r\n', '2019-04-01 11:50:12', 'Ya'),
(359, 4, 8, '3', 158, 'pengetahuan', '3.4	Mengalisis salah satu keterampilan aktifitas olahraga beladiri untuk menghasilkan gerak yang efektif ', 75, '75,75,75', 'â€¢	Menjelaskan tahapan teknik dasar pencak silat (teknik pukulan, tendangan, tangkisan, elakan, tangkapan, jatuhan, lepasan dan kuncian) yang dilakukan (berpasangan dan berkelompok) dengan koordinasi yang baik.', '2019-04-01 11:56:26', 'Ya'),
(360, 4, 8, '4', 160, 'keterampilan', '4.4	Mempraktikan salah satu keterampilan aktifitas olahraga beladiri untuk menghasilkan gerak yang efektif', 75, '75,75,75', 'â€¢	Melakukan latihan teknik dasar pencak silat (teknik pukulan, tendangan, tangkisan, elakan, tangkapan, jatuhan, lepasan dan kuncian) yang dilakukan (berpasangan dan berkelompok) dengan koordinasi yang baik.', '2019-04-01 11:57:54', 'Ya'),
(361, 4, 20, '3', 161, 'pengetahuan', '3.1 Menganalisis teknik dasar salah satu  aktifitas  olahraga permainan bola besar untuk menghasilkan koordinasi gerak yang baik', 75, '75,75,75', 'â€¢	Menentukan tahapan teknik dasar permainan bola besar \r\nâ€¢	Menemukan variasi teknik dasar permainan bola besar\r\n        Menganalisa kelebihan dan kelemahan masing-msing teknik dasar permainan bola besar\r\nâ€¢	Menganalisis kategori keterampilan gerak dalam permainan bolabasket\r\n', '2019-04-01 12:03:37', 'Ya'),
(362, 4, 20, '4', 162, 'keterampilan', '4.1 Mempraktikkan  teknik dasar salah satu aktifitas olahraga permainan bola besar untuk menghasilkan koordinasi gerak yang baik', 75, '75,75,75', 'â€¢	Mempraktikkan teknik dasar permainan bola besar (lanjutan)\r\nâ€¢	Mempraktikkan variasi teknik dasar permainan bola besar \r\n.       Mempraktikkan permainan bola besar dengan teknik yang lebih tinggi\r\n', '2019-04-01 12:07:02', 'Ya'),
(363, 4, 20, '3', 161, 'pengetahuan', '3.3 Menganalisis salah satu  keterampilan aktifitas atletik untuk menghasilkan gerak yang efektif', 75, '75,75,75', 'Menjelaskan tahapan variasi dan kombinasi teknik salah satu cabang atletik\r\nMenemukan variasi dan kombinasi teknik salah satu cabang atletik\r\nMenganalisis kelebihan dan kelemahan variasi dan kombinasi teknik dasar atletik\r\nâ€¢	 Menganalisis pengaruh permainan\r\njalan cepat terhadap kesehatan\r\nâ€¢	Menganalisis kategori keterampilan\r\ngerak lari\r\n', '2019-04-01 12:11:32', 'Ya'),
