(415, 4, 35, '4.29', 87, 'keterampilan', 'Menyusun teks interaksi transaksional lisan yang melibatkan tindakan memberi dan meminta informasi terkait jati diri dalam konteks pekerjaan (wawancara pekerjaan), dengan memperhatikan fungsi sosial, struktur teks, dan unsur kebahasaan yang benar dan sesuai konteks penggunaannya di dunia kerja.', 75, '75,75,75', '4.29.1 Menyusun teks lisan dan tertulis mengenai meminta dan memberi informasi terkait jati diri dalam konteks pekerjaan (wawancara pekerjaan) sesuai dengan konteks penggunaannya.\r\n\r\n4.29.2 Mengkomunikasikan secara lisan dan tertulis memberi dan meminta informasi tentang meminta dan memberi informasi terkait jati diri dalam konteks pekerjaan (wawancara pekerjaan)dengan menggunakan struktur teks dan unsur bahasa yang tepat sesuai dengan konteks penggunaan', '2019-04-15 15:39:09', 'Ya'),
