(417, 4, 35, '4.31', 87, 'keterampilan', 'Menangkap makna secara kontekstual terkait fungsi sosial, struktur teks, dan unsur kebahasaan teks news items lisan dan tulis, dalam bentuk berita sederhana koran/radio/TV', 75, '75,75,75', '4.31.1 Menyusun teks lisan dan tertulis mengenai suatu berita sesuai dengan konteks penggunaannya.\r\n4.31.2 Mengkomunikasikan secara lisan dan tertulis tentang teks berita dengan menggunakan struktur teks dan unsur kebahasaan yang tepat sesuai dengan konteks penggunaan', '2019-04-15 15:42:01', 'Ya'),
(418, 4, 35, '4.32', 87, 'keterampilan', 'Menyusun teks interaksi transaksional lisan dan tulis yang melibatkan tindakan memberi dan meminta informasi terkait pengandaian diikuti oleh perintah/saran, dengan memperhatikan fungsi sosial, struktur teks, dan unsur kebahasaan yang benar dan sesuai konteks', 75, '75,75,75', '4.32.1 Menyusun teks lisan dan tulis mengenai pengandaian diikuti oleh perintah/saran sesuai dengan konteks penggunaannya.\r\n\r\n4.32.2 Mengkomunikasikan secara lisan dan tulis ungkapan tentang pengandaian diikuti oleh perintah/saran dengan menggunakan struktur teks dan unsur kebahasaan yang tepat sesuai dengan konteks penggunaan', '2019-04-15 15:43:27', 'Ya'),
