(432, 4, 6, '3.12', 120, 'pengetahuan', 'Menganalisis fungsi social, struktur teks dan unsur kebahasaan teks interaksi transaksional yang melibatkan tindakan memberi dan meminta informasi terkait kegiatan/ tugas-tugas rutin sederhana (simple routine tasks) sesuai dengan konteks penggunaan di dunia kerja. ', 75, '75,75,75', '3.12.1 Mengidentifi kasi  fungsi sosial, struktur teks dan unsur kebahasaan dalam teks terkait kegiatan rutin sederhana sesuai dengan konteks penggunaannya.\r\n\r\n3.12.2 Membedakan  fungsi sosial, struktur teks dan unsur bahasa dari berbagai ungkapan mengenai kegiatan rutin sederhana sesuai dengan konteks penggunaannya.', '2019-05-16 11:12:46', 'Ya'),
(433, 4, 6, '4.12', 121, 'keterampilan', 'Menyusun teks interaksi transaksional lisan dan tulis, pendek dan sederhana yang melibatkan tindakan memberi dan meminta informasi terkait kegiatan/ tugas-tugas rutin sederhana (simple routine tasks) dengan memperhatikan fungsi social, struktur teks dan unsur kebahasaan yang benar dan sesuai konteks dunia kerja.', 75, '75,75,75', '4.12.1 Menyusun teks lisan dan tulis mengenai kegiatan rutin sederhanadengan menggunakan struktur teks dan unsur bahasa yang tepatsesuai dengan konteks penggunaannya.\r\n\r\n4.12.2 Mengkomuni kasikan secara lisan dan tertulis tentang kegiatan rutin sederhanadengan menggunakan struktur teks dan unsur bahasa yang tepat sesuai dengan konteks penggunaan', '2019-05-16 11:14:23', 'Ya'),
(434, 4, 6, '3.13', 120, 'pengetahuan', 'Menganalisis fungsi sosial, struktur teks, dan unsur kebahasaan teks interaksi transaksional lisan dan tulis yang melibatkan tindakan memberi dan meminta informasi terkait saran dan tawaran, sesuai dengan konteks penggunaannya. ', 75, '75,75,75', '3.13.1 Mengidentifi kasi  fungsi sosial, struktur teks dan unsur kebahasaan dalam teks tentang meminta dan memberi saran dan tawaran sesuai dengan konteks penggunaannya.\r\n\r\n3.13.2 Membedakan  fungsi sosial, struktur teks dan unsur bahasa dari berbagai ungkapan mengenai memberi dan meminta informasi tentang saran dan tawaran sesuai dengan konteks penggunaannya.', '2019-05-16 11:15:25', 'Ya'),
(435, 4, 6, '4.13', 121, 'keterampilan', 'Menyusun teks interaksi transaksional, lisan dan tulis, pendek dan sederhana, yang melibatkan tindakan memberi dan meminta informasi terkait saran dan tawaran, dengan memperhatikan fungsi sosial, struktur teks, dan unsur kebahasaan yang benar dan sesuai konteks', 75, '75,75,75', '4.13.1 Menyusun teks lisan dan tertulis mengenai meminta dan memberi saran dan tawaran dengan menggunakan struktur teks dan unsur kebahasaan yang tepat sesuai dengan konteks penggunaannya.\r\n\r\n4.13.2 Mengkomuni kasikan secara lisan dan tertulis ungkapan tentang meminta dan memberi saran dan tawaran dengan menggunakan struktur teks dan unsur kebahasaan yang tepat sesuai dengan konteks penggunaan', '2019-05-16 11:16:52', 'Ya'),
