(460, 4, 17, '3.16', 116, 'pengetahuan', 'Menganalisis alur cerita babak demi babak, konflik dan kebahasaan dalam drama yang dibaca atau ditonton', 75, '75,75,75', '1. Peserta didik mampu menentukan alur yang digunakan untuk pengembangan cerita yang terdapat dalam drama dengan tepat.\r\n2. Peserta didik mampu menentukan konflik yang terdapat dalam drama yang ditonton maupun dibaca dengan benar.\r\n3. Peserta didik mampu menentukan kebahasaan yang terdapat dalam drama sesuai kaidah bahasa teks drama.\r\n', '2019-05-28 08:32:44', 'Ya'),
(461, 4, 17, '3.17 ', 116, 'pengetahuan', 'Menganalisis pesan dari dua buku fiksi (novel atau buku kumpulan puisi) yang dibaca dengan situasi kekinian', 75, '75,75,75', '1. Peserta didikdapat menentukan unsur pembangun novel secara umum dengan tepat.\r\n2. Peserta didi dapat menentukan unsur pembangun puisi yang terdapat dalam buku kumpulan puisi secara umum dengan benar.\r\n3. Peserta didik dapat menentukan pesan yang terkandung dalam novel atau buku kumpulan puisi denag benar.', '2019-05-28 08:38:30', 'Ya'),
(462, 4, 17, '4.16', 119, 'keterampilan', 'Mempertunjukan salah satu tokoh atau mendemonstrasikan sebuah naskah drama dengan memperhatikan isi dan kebahasaan  dalam drama yang dibaca atau ditonton secara lisan', 75, '75,75,75', '1. peserta didik dapat mempertunjukan salah satu karakter tokoh dalam drama yang dibaca maupun ditonton dengan benar.\r\n2. peserta didik  dapat mendemonstrasikan dengan benar karakter tokoh sesuai dengan skenario yang terdapat dalam naskah drama.', '2019-05-28 08:43:46', 'Ya'),
