(571, 4, 9, '4.1', 15, 'keterampilan', 'Menggunakan fungsi-fungsi Perintah (Command)', 75, '75,75,75', '4.1.1 Menerapkan Algoritama dalam bentuk flowchart sederhana dalam kehidupan sehari-hari.\r\n4.1.2 Membuat tulisan rincian aktivitas dalam runtutan satuan kesatuan kegitan berdasarkan terkait dengan kegiatan keseharian\r\n', '2019-07-15 08:35:08', 'Ya'),
