(576, 4, 9, '3.4', 14, 'pengetahuan', 'Menerapkan logika, dan operasi perhitungan data', 75, '75,75,75', '3.4.1 Menjelaskan urutan kerja operator matematika.\r\n3.4.2 Mengurutkan operator matematika sesuai hasil yang diharapkan.\r\n3.4.3 Menentukan penggunaan fungsi logika IF, AND, OR, ELSE pada perhitungan berkondisi.\r\n3.4.3 Memanipulasi sel.\r\n3.4.4 Menyalin nilai berdasarkan referensi nilai sel dan referensi alamat sel\r\n', '2019-07-15 09:42:36', 'Ya'),
