(578, 4, 9, '3.5', 14, 'pengetahuan', 'Menganalisis fitur yang tepat untuk pembuatan slide', 75, '75,75,75', '3.5.1 Menjelaskan jenis, fungsi, dan keuntungan penggunaan perangkat lunak presentasi.\r\n3.5.2 Menentukan fitur umum yang sering digunakan pada perangkat lunak presentasi.\r\n3.5.3 Menganalisis slide yang sesuai dengan pesan yang akan disampaikan.\r\n', '2019-07-15 09:51:40', 'Ya'),
