(580, 4, 9, '3.6', 14, 'pengetahuan', 'Menerapkan teknik presentasi yang efektif', 75, '75,75,75', '3.6.1 Menentukan desain yang efektif.\r\n3..6.2 Membandingkan kesesuaian desain slide dengan informasi yang disampaikan.\r\n3.6.3 Menilai teknik penyempaian presentasi orang lain.\r\n', '2019-07-15 09:54:59', 'Ya'),
(581, 4, 9, '4.6', 15, 'keterampilan', 'Melakukan presentasi yang efektif', 75, '75,75,75', '4.6.1 Membuat slide dengan pertimbangan proporsi, komposisi, dan harmoni.\r\n4.6.2 Melaksanakan penyampaian sesuai kaidah teknik presentasi.\r\n', '2019-07-15 09:56:19', 'Ya'),
(582, 4, 9, '3.7', 14, 'pengetahuan', 'Menganalisis pembuatan E-book', 75, '75,75,75', '3.7.1 Menjelaskan contoh dan kelebihan E-book.\r\n3.7.2 Menjelaskan berbagai format E-book.\r\n3.7.3 Mengurutkan proses konversi.\r\n3.7.4 Memilih perangkat lunak pembaca file E-book.\r\n3.7.5 Memilih informasi pada metadata.\r\n', '2019-07-15 09:57:44', 'Ya'),
(583, 4, 9, '4.7', 15, 'keterampilan', ' Membuat E-book dengan perangkat lunak E-book Editor', 75, '75,75,75', '4.7.1 Melaksanakan konversi file menjadi HTML.\r\n4.7.2 Melengkapi file E-book dengan file multimedia.\r\n4.7.3 Melengkapi daftar is pada E-booki.\r\n4.7.4 Membuat sampul.\r\n4.7.5 Melengkapi metadata.\r\n4.7.6 Menampilkan file E-book\r\n', '2019-07-15 09:59:36', 'Ya'),
(584, 4, 19, '4', 212, 'keterampilan', '4.13. Menyusun teks interaksi transaksional, lisan dan tulis, pendek dan sederhana, yang melibatkan tindakan memberi dan meminta informasi terkait saran dan tawaran, dengan memperhatikan fungsi sosial, struktur teks, dan unsur kebahasaan yang benar dan sesuai konteks', 75, '75,75,75', '4.13.1   Menyusun teks lisan dan tertulis mengenai meminta dan memberi saran dan tawaran dengan menggunakan struktur teks dan unsur kebahasaan yang tepat sesuai dengan konteks penggunaannya.', '2019-07-15 14:52:45', 'Ya'),
(585, 4, 19, '3', 17, 'pengetahuan', '3.13 Menganalisis fungsi sosial, struktur teks, dan unsur kebahasaan teks interaksi transaksional lisan dan tulis yang melibatkan tindakan memberi dan meminta informasi terkait saran dan tawaran, sesuai dengan konteks penggunaannya. ', 75, '75,75,75', '3.13.1 Mengidentifikasi  fungsi sosial, struktur teks dan unsur kebahasaan dalam teks tentang meminta dan memberi saran dan tawaran sesuai dengan konteks penggunaannya.', '2019-07-15 14:56:48', 'Ya'),
