(588, 4, 19, '3', 17, 'pengetahuan', '3.15 Menerapkan fungsi social, struktur teks dan unsur kebahasaan teks interaksi transaksional yang melibatkan tindakan memberi dan meminta informasi terkait pesan sederhana lewat telephone (taking simple phone message) sesuai dengan konteks penggunaannya di dunia kerja', 75, '75,75,75', '4.15.1 \r\nMenyusun teks lisan dan tertulis berupa pesan sederhana lewat telephone terkait tempat kerja sesuai dengan konteks penggunaannya.\r\n', '2019-07-15 15:15:00', 'Ya'),
(589, 4, 19, '4', 212, 'keterampilan', '4.15  Menuliskan kembali teks pesan sederhana lewat telephone terkait tempat kerja dengan memperhatikan fungsi sosial, struktur teks dan unsur kebahasaan secara benar dan sesuai konteks dunia kerja', 75, '75,75,75', '', '2019-07-15 15:17:51', 'Ya'),
(590, 4, 19, '3', 17, 'pengetahuan', ' 3.16 Menganalisis fungsi sosial, struktur teks, dan unsur kebahasaan beberapa teks khusus dalam bentuk undangan resmi dengan memberi dan meminta informasi terkait kegiatan sekolah/tempat kerja sesuai dengan konteks penggunaanya', 75, '75,75,75', '3.16.1 \r\n   Mengidentifikasi  fungsi sosial, struktur teks dan unsur kebahasaan dalam teks undangan resmi sesuai dengan konteks penggunaanya\r\n', '2019-07-15 15:20:14', 'Ya'),
(591, 4, 19, '4', 212, 'keterampilan', '4.16  Menyusun teks khusus dalam bentuk undangan resmi lisan dan tulis, terkait kegiatan sekolah/tempat kerja, dengan memperhatikan fungsi dan unsur, struktur teks, dan unsur kebahasaan, secara benar dan sesuai konteks', 75, '75,75,75', '4.16.1   \r\nMenyusun teks lisan dan tulis mengenai undangan resmi dengan menggunakan struktur teks dan unsur kebahasaan yang tepat sesuai dengan konteks penggunaanya.\r\n', '2019-07-15 15:22:33', 'Ya'),
(592, 4, 19, '3', 17, 'pengetahuan', '3.17 Membedakan fungsi sosial, struktur teks, dan unsur kebahasaan beberapa teks khusus dalam bentuk surat pribadi dengan memberi dan menerima informasi terkait kegiatan diri sendiri dan orang sekitarnya, sesuai dengan konteks penggunaannya', 75, '75,75,75', '3.17.1 \r\n  Mengidentifikasi    fungsi sosial, struktur teks dan unsur kebahasaan dalam teks surat pribadi dengan memberi dan menerima informasi terkait kegiatan diri sendiri dan orang sekitarnya sesuai dengan konteks penggunaanya.\r\n', '2019-07-15 15:24:52', 'Ya'),
(593, 4, 19, '4', 212, 'keterampilan', '4.17  Menyusun teks khusus dalam bentuk surat pribadi terkait kegiatan diri sendiri dan orang sekitarnya, lisan dan tulis, dengan memperhatikan fungsi sosial, struktur teks, dan unsur kebahasaan, secara benar dan sesuai konteks', 75, '75,75,75', '4.17.1 \r\n           Menyusun teks surat pribadi dengan memberi dan menerima informasi terkait kegiatan diri sendiri dan orang sekitarnya sesuai dengan konteks penggunaanya\r\n', '2019-07-15 15:26:50', 'Ya'),
(594, 4, 19, '3', 17, 'pengetahuan', '3.18 Menganalisis fungsi sosial, struktur teks, dan unsur kebahasaan beberapa teks prosedur lisan dan tulis dengan memberi dan meminta informasi terkait manual penggunaan teknologi dan kiat-kiat (tips), pendek dan sederhana, sesuai dengan bidang keahlian dan konteks penggunaannya', 75, '75,75,75', '3.18.1 \r\nMengidentifikasi  fungsi sosial, struktur teks dan unsur kebahasaan dalam teks prosedur berupa manual dan tips sesuai dengan konteks penggunaannya.\r\n', '2019-07-15 15:30:37', 'Ya'),
(595, 4, 19, '4', 212, 'keterampilan', '4.18 Menyusun teks prosedur, lisan dan tulis, dalam bentuk manual terkait penggunaan teknologi dan kiat-kiat (tips), dengan memperhatikan fungsi sosial, struktur teks, dan unsur kebahasaan, secara benar dan sesuai konteks', 75, '75,75,75', '4.18.1 \r\n\r\nMenyusun teks lisan dan tertulis mengenai teks prosedur berupa teks manual dan tips  dengan menggunakan struktur teks dan unsur bahasa yang tepat sesuai dengan konteks penggunaannya\r\n', '2019-07-15 15:31:43', 'Ya'),
(596, 4, 19, '3', 17, 'pengetahuan', '3.13 Menganalisis fungsi sosial, struktur teks, dan unsur kebahasaan teks interaksi transaksional lisan dan tulis yang melibatkan tindakan memberi dan meminta informasi terkait saran dan tawaran, sesuai dengan konteks penggunaannya. ', 75, '75,75,75', '3.13.1\r\nMengidentifikasi  fungsi sosial, struktur teks dan unsur kebahasaan dalam teks tentang meminta dan memberi saran dan tawaran sesuai dengan konteks penggunaannya.\r\n', '2019-07-15 15:36:44', 'Ya'),
