(82, 4, 31, '1', 'Menghayati dan mengamalkan ajaran agama yang dianutnya'),
(83, 4, 31, '2', 'Menghayati dan mengamalkan perilaku jujur, disiplin, tanggung jawab, peduli (gotong-royong, kerja sama,  toleran, damai), santun, responsif dan proaktif dan menunjukkan sikap sebagai bagian dari solusi atas berbagai permasalahan dalam berinteraksi secara efektif dengan lingkungan sosial dan alam serta dalam menempatkan diri sebagai cerminan bangsa dalam pergaulan dunia'),
(71, 4, 42, '3', 'Memahami, menerapkan, dan menganalisis pengetahuan faktual, konseptual, dan  prosedural, berdasarkan rasa ingin tahunya tentang ilmu pengetahuan, teknologi, seni, budaya, dan humaniora dengan wawasan kemanusiaan, kebangsaan, kenegaraan, dan peradaban terkait penyebab fenomena dan kejadian dalam bidang kerja yang spesifik untuk memecahkan masalah.'),
(14, 4, 9, 'KI-3 (Pengetahuan', 'Memahami, menerapkan, menganalisis, dan mengevaluasi tentang pengetahuan \r\nfaktual, konseptual, operasional dasar, dan metakognitif sesuai dengan bidang dan lingkup  Simulasi dan Komunikasi Digital (Simdig) pada tingkat teknis, spesifik, detil, dan kompleks, berkenaan dengan ilmu pengetahuan, teknologi, seni, budaya, dan humaniora dalam konteks pengembangan potensi diri sebagai bagian dari keluarga, sekolah, dunia kerja, warga masyarakat nasional, regional, dan internasional.\r\n'),
(15, 4, 9, 'KI-4 (Keterampilan)	: ', 'Melaksanakan tugas spesifik dengan menggunakan alat, informasi, dan prosedur kerja \r\nyang lazim dilakukan serta memecahkan masalah sesuai dengan lingkup Simulasi dan Komunikasi Digital (Simdig). Menampilkan kinerja di bawah bimbingan dengan mutu dan kuantitas yang terukur sesuai dengan standar kompetensi kerja.\r\n\r\nMenunjukkan keterampilan menalar, mengolah, dan menyaji secara efektif, kreatif, produktif, kritis, mandiri, kolaboratif, komunikatif, dan solutif dalam ranah abstrak terkait dengan pengembangan dari yang dipelajarinya di sekolah, serta mampu melaksanakan tugas spesifik di bawah pengawasan langsung.\r\n\r\nMenunjukkan keterampilan mempersepsi, kesiapan, meniru, membiasakan, gerak mahir, menjadikan gerak alami dalam ranah konkret terkait dengan pengembangan dari yang dipelajarinya di sekolah, serta mampu melaksanakan tugas spesifik di bawah pengawasan langsung.\r\n'),
(16, 4, 19, '3.16', 'Memahami, menerapkan, menganalisis, dan mengevaluasi tentang pengetahuan faktual, konseptual, prosedural dasar, dan metakognitif sesuai dengan bidang dan lingkup kajian Bahasa Inggris pada tingkat teknis, spesifik, detil, dan kompleks, berkenaan dengan ilmu pengetahuan, teknologi, seni, budaya, dan humaniora dalam konteks pengembangan potensi diri sebagai bagian dari keluarga, sekolah, dunia kerja,\r\n   warga masyarakat nasional, regional, dan internasional \r\n\r\n'),
