(138, 4, 50, 'KI 4', 'Melaksanakan tugas specifik dengan menggunakan alat , informasi, dan prosedur kerja yang lazim dilakukan serta memecahkan masalah sesuai dengan bidang kerja Kimia Industri. Menampilkan kinerja di bawah bimbingan dengan mutu dan kuantitas yang terukur sesuai dengan standar kompetensi kerja. \r\nMenunjukan ketrampilan menalar, mengolah, dan menyaji secara efektif, kreatif, produktif, kritis, mandiri kolaboratif, komunikatif, dan solutif dalam ranah abstrak terkait dengan pengembangan dari yang dipelajarinya di sekolah, serta mampu melaksanakan tugas specific di bawah pengawasan langsung. \r\n		Menunjukan ketrampilan mempersepsi, kesiapan, meniru, membiasakan, gerak mahir, menjadikan gerak alami dalam ranah konkret terkait dengan pengembangan dari yang dipelajarinya di sekolah, serta mampu melaksanakan tugas specific di bawah pengawasan langsung.'),
