(194, 4, 15, '3.11', 'Mempertahankan keyakinan yang benar sesuai ajaran Islam dalam sejarah Peradaban Islam pada masa modern. Bersikap rukun dan kompetitif dalam kebaikan dalam implementasi nilai sejarah peradaban islam pada masa morern'),
(195, 4, 15, '3.11', 'Menelaah perkembangan Islam pada masa Modern (1800-Sekarang)'),
(196, 4, 15, '3.11', 'Menelaah perkembangan Islam pada masa modern (1800-sekarang)'),
(197, 4, 25, '3.3.6', 'Memahami, menerapkan dan menganalisis pengetahuan gambar potongan'),
(198, 4, 25, '3.3.7', 'memahami dan menganalisis pengetahuan tentang gambar potongan'),
(199, 4, 3, '3', 'Menganalisis butir-butir penting yang dapat diteladani dari teks biografi berkaitan dengan bidang pekerjaan serta aspek makna dan kebahasaannya'),
(200, 4, 3, '3', 'Menganalisis unsur pembangun puisi (suasana, tema, dan makna) beberapa puisi yang terkandung dalam antologi puisi yang diperdengarkan atau dibaca'),
(201, 4, 3, '3', 'Menganalisis isi dari minimal satu buku fiksi dan satu buku nonfiksi yang sudah dibaca'),
(202, 4, 3, '4', 'Menyajikan hal-hal yang dapat diteladani dari tokoh yang terdapat dalam teks biografi berkaitan dengan bidang pekerjaan yang dibaca secara tertulis dan membuat teks biografi baik lisan maupun tulisan'),
(203, 4, 3, '4', 'Mendemonstrasikan satu puisi dari antologi puisi dengan memerhatikan vokal, ekspresi, dan intonasi serta menulis puisi dengan memperhatikan unsur pembangun'),
(204, 4, 3, '4', 'Menyajikan replikasi isi buku ilmiah yang dibaca dalam bentuk resensi'),
(205, 4, 37, '3', 'Memahami, menerapkan, menganalisis, dan mengevaluasi tentang pengetahuan faktual, konseptual, operasional dasar, dan metakognitif sesuai dengan bidang dan lingkup kajian kimia teknologi rekayasa pada tingkat teknis, spesifik, detil, dan kompleks, berkenaan dengan ilmu pengetahuan, teknologi, seni, budaya, dan humaniora dalam konteks pengembangan potensi diri sebagai bagian dari keluarga, sekolah, dunia kerja, warga masyarakat nasional, regional, dan internasional.'),
(206, 4, 37, '4', 'Melaksanakan tugas spesifik dengan menggunakan alat, informasi, dan prosedur kerja yang lazim dilakukan serta memecahkan masalah sesuai dengan bidang kajian Kimia  Teknologi dan Rekayasa. \r\nMenampilkan kinerja di bawah bimbingan dengan mutu dan kuantitas yang terukur sesuai dengan standar kompetensi kerja.\r\nMenunjukkan keterampilan menalar, mengolah, dan menyaji secara efektif, kreatif, produktif, kritis, mandiri, kolaboratif, komunikatif, dan solutif dalam ranah abstrak terkait dengan pengembangan dari yang dipelajarinya di sekolah, serta mampu melaksanakan tugas spesifik di bawah pengawasan langsung.	\r\nMenunjukkan keterampilan mempersepsi, kesiapan, meniru, membiasakan, gerak mahir, menjadikan gerak alami dalam ranah konkret terkait dengan pengembangan dari yang dipelajarinya di sekolah, serta mampu melaksanakan tugas spesifik di bawah pengawasan langsung\r\n'),
(207, 4, 58, 'DRLK.X', 'Memahami, menerapkan, menganalisis, dan mengevaluasi tentang pengetahuan faktual, konseptual, operasional lanjut, dan metakognitif secara multi disiplin sesuai dengan bidang dan lingkup kerja Dasar-dasar Teknik Ketenagalistrikan pada tingkat teknis, spesifik, detil, dan kompleks, berkenaan dengan ilmu pengetahuan, teknologi, seni, budaya, dan humaniora dalam konteks pengembangan potensi diri sebagai bagian dari keluarga, sekolah, dunia kerja, warga masyarakat nasional, regional, dan internasional.'),
(208, 4, 57, '3', 'Memahami, menerapkan, menganalisis, dan mengevaluasi tentang pengetahuan faktual, konseptual, operasional lanjut, dan metakognitif secara multi disiplin sesuai dengan bidang dan lingkup kerja Dasar-dasar Teknik Ketenagalistrikan pada tingkat teknis, spesifik, detil, dan kompleks, berkenaan dengan ilmu pengetahuan, teknologi, seni, budaya, dan humaniora dalam konteks pengembangan potensi diri sebagai bagian dari keluarga, sekolah, dunia kerja, warga masyarakat nasional, regional, dan internasional.'),
(209, 4, 58, '3', 'Memahami, menerapkan, menganalisis, dan mengevaluasi tentang pengetahuan faktual, konseptual, operasional lanjut, dan metakognitif secara multi disiplin sesuai dengan bidang dan lingkup kerja Dasar-dasar Teknik Ketenagalistrikan pada tingkat teknis, spesifik, detil, dan kompleks, berkenaan dengan ilmu pengetahuan, teknologi, seni, budaya, dan humaniora dalam konteks pengembangan potensi diri sebagai bagian dari keluarga, sekolah, dunia kerja, warga masyarakat nasional, regional, dan internasional.'),
(210, 4, 57, '4', 'Melaksanakan tugas spesifik dengan menggunakan alat, informasi, dan prosedur kerja yang lazim dilakukan serta memecahkan masalah sesuai dengan bidang kerja Dasar-dasar Teknik Ketenagalistrikan. Menampilkan kinerja mandiri dengan mutu dan kuantitas yang terukur sesuai dengan standar kompetensi kerja. Menunjukkan keterampilan menalar, mengolah, dan menyaji secara efektif, kreatif, produktif, kritis, mandiri, kolaboratif, komunikatif, dan solutif dalam ranah abstrak terkait dengan pengembangan dari yang dipelajarinya di sekolah, serta mampu melaksanakan tugas spesifik secara mandiri. Menunjukkan keterampilan mempersepsi, kesiapan, meniru, membiasakan, gerak mahir, menjadikan gerak alami, sampai dengan tindakan orisinal dalam ranah konkret terkait dengan pengembangan dari yang dipelajarinya di sekolah, serta mampu melaksanakan tugas spesifik secara mandiri.'),
(211, 4, 58, '4', 'Melaksanakan tugas spesifik dengan menggunakan alat, informasi, dan prosedur kerja yang lazim dilakukan serta memecahkan masalah sesuai dengan bidang kerja Dasar-dasar Teknik Ketenagalistrikan. Menampilkan kinerja mandiri dengan mutu dan kuantitas yang terukur sesuai dengan standar kompetensi kerja. Menunjukkan keterampilan menalar, mengolah, dan menyaji secara efektif, kreatif, produktif, kritis, mandiri, kolaboratif, komunikatif, dan solutif dalam ranah abstrak terkait dengan pengembangan dari yang dipelajarinya di sekolah, serta mampu melaksanakan tugas spesifik secara mandiri. Menunjukkan keterampilan mempersepsi, kesiapan, meniru, membiasakan, gerak mahir, menjadikan gerak alami, sampai dengan tindakan orisinal dalam ranah konkret terkait dengan pengembangan dari yang dipelajarinya di sekolah, serta mampu melaksanakan tugas spesifik secara mandiri.'),
(212, 4, 19, '4', '4.	Mengolah, menalar, menyaji, dan mencipta dalam ranah konkret dan ranah abstrak terkait dengan pengembangan dari yang dipelajarinya di sekolah secara mandiri serta bertindak secara efektif dan kreatif, dan mampu menggunakan metoda sesuai kaidah keilmuan\r\n\r\n\r\n\r\n4.	Mengolah, menalar, menyaji, dan mencipta dalam ranah konkret dan ranah abstrak terkait dengan pengembangan dari yang dipelajarinya di sekolah secara mandiri serta bertindak secara efektif dan kreatif, dan mampu menggunakan metoda sesuai kaidah keilmuan\r\n\r\n\r\n\r\n4.	Mengolah, menalar, menyaji, dan mencipta dalam ranah konkret dan ranah abstrak terkait dengan pengembangan dari yang dipelajarinya di sekolah secara mandiri serta bertindak secara efektif dan kreatif, dan mampu menggunakan metoda sesuai kaidah keilmuan\r\n\r\n\r\n\r\n\r\n\r\n\r\n'),
(213, 4, 67, '3', 'Memahami, menerapkan, menganalisis, dan mengevaluasi tentang pengetahuan faktual, konseptual, operasional dasar, dan metakognitif sesuai dengan bidang dan lingkup kerja Kimia Industri pada tingkat teknis, spesifik, detil, dan kompleks, berkenaan dengan ilmu pengetahuan, teknologi, seni, budaya, dan humaniora dalam konteks pengembangan potensi diri sebagai bagian dari keluarga, sekolah, dunia kerja, warga masyarakat nasional, regional, dan internasional'),
