(215, 4, 67, '4', 'Menunjukkan keterampilan menalar, mengolah, dan menyaji secara efektif, kreatif, produktif, kritis, mandiri, kolaboratif, komunikatif, dan solutif dalam ranah abstrak terkait dengan pengembangan dari yang dipelajarinya di sekolah, serta mampu melaksanakan tugas spesifik di bawah pengawasan langsung.\r\nMenunjukkan keterampilan mempersepsi, kesiapan, meniru, membiasakan, gerak mahir, menjadikan gerak alami dalam ranah konkret terkait dengan pengembangan dari yang dipelajarinya di sekolah, serta mampu melaksanakan tugas spesifik di bawah pengawasan langsung.\r\n'),
(216, 4, 68, '3', 'Memahami, menerapkan, menganalisis, dan mengevaluasi tentang pengetahuan \r\nfaktual, konseptual, operasional dasar, dan metakognitif sesuai dengan bidang dan lingkup  Simulasi dan Komunikasi Digital (Simdig) pada tingkat teknis, spesifik, detil, dan kompleks, berkenaan dengan ilmu pengetahuan, teknologi, seni, budaya, dan humaniora dalam konteks pengembangan potensi diri sebagai bagian dari keluarga, sekolah, dunia kerja, warga masyarakat nasional, regional, dan internasional.\r\n'),
(217, 4, 68, 'KI-3 (Pengetahuan', 'Memahami, menerapkan, menganalisis, dan mengevaluasi tentang pengetahuan \r\nfaktual, konseptual, operasional dasar, dan metakognitif sesuai dengan bidang dan lingkup  Simulasi dan Komunikasi Digital (Simdig) pada tingkat teknis, spesifik, detil, dan kompleks, berkenaan dengan ilmu pengetahuan, teknologi, seni, budaya, dan humaniora dalam konteks pengembangan potensi diri sebagai bagian dari keluarga, sekolah, dunia kerja, warga masyarakat nasional, regional, dan internasional.\r\n'),
(218, 4, 68, 'KI-4 (Keterampilan)	: ', 'Melaksanakan tugas spesifik dengan menggunakan alat, informasi, dan prosedur kerja \r\nyang lazim dilakukan serta memecahkan masalah sesuai dengan lingkup Simulasi dan Komunikasi Digital (Simdig). Menampilkan kinerja di bawah bimbingan dengan mutu dan kuantitas yang terukur sesuai dengan standar kompetensi kerja.\r\n\r\nMenunjukkan keterampilan menalar, mengolah, dan menyaji secara efektif, kreatif, produktif, kritis, mandiri, kolaboratif, komunikatif, dan solutif dalam ranah abstrak terkait dengan pengembangan dari yang dipelajarinya di sekolah, serta mampu melaksanakan tugas spesifik di bawah pengawasan langsung.\r\n\r\nMenunjukkan keterampilan mempersepsi, kesiapan, meniru, membiasakan, gerak mahir, menjadikan gerak alami dalam ranah konkret terkait dengan pengembangan dari yang dipelajarinya di sekolah, serta mampu melaksanakan tugas spesifik di bawah pengawasan langsung.\r\n'),
(219, 4, 17, '3', 'Memahami, menerapkan, menganalisis, dan mengevaluasi tentang pengetahuan faktual, konseptual, operasional dasar, dan metakognitif sesuai dengan bidang dan lingkup kajian bahasa Indonesia pada tingkat teknis, spesifik, detil, dan kompleks, berkenaan dengan ilmu pengetahuan, teknologi, seni, budaya, dan humaniora dalam konteks pengembangan potensi diri sebagai bagian dari keluarga, sekolah, dunia kerja, warga masyarakat nasional, regional, dan internasional.'),
