INSERT INTO `rb_psb_halaman` (`id_halaman`, `judul`, `judul_seo`, `isi_halaman`, `username`) VALUES
(1, 'Cara Pendaftaran', 'cara-pendaftaran', '<p><strong>Jadwal Penting:</strong>\r\n\r\nDengan ini disampaikan bahwa Kuota Penerimaan Siswa Baru Tahun Pelajaran 2019/2020 Program Keahlian Teknik Otomasi Industri (TOI)\r\n\r\n<strong>telah terpenuhi&nbsp;</strong>pada pukul 09.00 WIB.\r\n\r\nDengan demikian Penerimaan Cadangan untuk Program Keahlian TOI dinyatakan <u><strong>TIDAK ADA</strong></u><strong>.</strong>\r\n\r\nKlik link dibawah ini untuk prosedur lengkap registrasi :\r\n\r\n<strong><a target=\"_blank\" rel=\"nofollow\">Prosedur Registrasi</a></strong>\r\n\r\n<strong>A. Bagi pendaftar baru</strong>\r\n\r\n<strong>1. </strong>silahkan melakukan registrasi pada<strong> menu register</strong>\r\n\r\n</p><blockquote>\r\n<strong>(harap ingat dan catat username/email dan password yang anda inputkan untuk login kembali pada menu login)</strong>\r\n</blockquote>\r\n\r\n<strong>2. </strong>lalu silahkan isi lengkap data yang diperlukan pada <strong>menu pendaftaran</strong>\r\n\r\n<strong>B. Bagi pendaftar yang telah mendaftarkan diri di SMK SMTI Padang</strong>\r\n\r\n<strong>1. </strong>silahkan login menggunakan kartu yang diberikan petugas pada<strong> menu login</strong>\r\n\r\n<strong>2. </strong>harap isi lengkap data yang diperlukan pada<strong> menu pendaftaran</strong>\r\n\r\n<strong>C. Jika data sudah terisi lengkap</strong>\r\n\r\n<strong>1. </strong>lakukan pembayaran uang pendaftaran sebesar<strong> Rp. 50.000,-</strong>\r\n\r\n<strong>2. </strong>kirimkan bukti pembayaran\r\n\r\n<blockquote>\r\n<strong>dengan format: namalengkap/NISN/sekolah asal beserta foto bukti pembayaran</strong>\r\n\r\n<strong>melalui via WA atau media sosial SMK LIMAKODE</strong>\r\n</blockquote>\r\n\r\n<strong>3. </strong>cetak kartu ujian seleksi online pada<strong> menu pendaftaran</strong>\r\n\r\n<blockquote>\r\n<strong>Jadwal PSB SMK LIMAKODE Tahun 2019</strong>\r\n</blockquote>\r\n\r\n<p>&nbsp;</p>', 'admin'),
(2, 'Prosedur Pendaftaran Siswa Baru', 'prosedur-pendaftaran-siswa-baru', '<p><b>Syarat Umum Pendaftaran</b><br></p><p></p><ol><li>Siswa lulusan SMP/MTs/Sederajat tahun 2019<br></li><li>Membawa surat keterangan berkelakuan baik dari kepala sekolah yang bersangkutan<br></li><li>Berbadan sehat, tidak bertato, tidak memakai narkoba dan tidak tindik telinga (bagi laki-laki)<br></li><li>Tidak buta warna (dibuktikan oleh tim yang ditunjuk oleh SMK Limakode)<br></li><li>Pendaftaran dilakukan secara online dengan mengisi formulir melalui situs <a target=\"_blank\" rel=\"nofollow\" href=\"http://demo.limakode.com/simasta\">www.smklimakode.sch.id</a></li><p>atau&nbsp;datang&nbsp;langsung&nbsp;ke lokasi SMK Limakode</p><p>Perum New Kartika Asri Blok A1/3<br></p><p>e-mail: sales@limakode.com</p><li>Pas foto&nbsp;warna&nbsp;ukuran&nbsp;3x4&nbsp;(dua)&nbsp;lembar<br></li></ol><p><b>Jalur Seleksi</b></p><p><b></b>Dapat&nbsp;dilihat&nbsp;pada&nbsp;gambar diagram&nbsp;pada&nbsp;bagian&nbsp;kanan</p>1. Jalur&nbsp;seleksi&nbsp;rapor<blockquote><div>membawa&nbsp;foto kopi rapor semester 1 s.d. 5 yang dilegalisir, pas foto&nbsp;berwarna 3x4 (dua) lembar,</div><div>Surat Keterangan Kelakuan Baik dari sekolah&nbsp;pada&nbsp;saat&nbsp;validasi&nbsp;dokumen</div></blockquote><div>2. Jalur&nbsp;seleksi&nbsp;Tes&nbsp;(USMSB-BK)</div><blockquote>membawa pas foto&nbsp;berwarna 3x4 (dua) lembar,<div>Surat Keterangan Kelakuan Baik dari sekolah pada saat validasi dokumen</div></blockquote><div><p></p><b></b><p></p></div>', 'admin'),
(5, 'Pendaftaran Telah Ditutup', 'pendaftaran-telah-ditutup', '<p></p>tutup bos<br><p></p><p></p>', '165');
