INSERT INTO `rb_pustaka_buku` (`id_buku`, `id_identitas_sekolah`, `id_kategori`, `kode_buku`, `judul`, `pengarang`, `penerbit`, `foto`, `deskripsi`, `jumlah`, `tahun_terbit`, `tahun_pengadaan`, `harga_buku`, `sumber_dana`, `id_guru`) VALUES
(1, 1, 4, 'BK-001', 'Belajar Menaklukkan PHP dalam 1 Minggu', 'Robby Prihandaya', 'Lokomedia', '20181204094815-images.jpg', 'Didalam buku ini dibahas dua buah sistem, yaitu Online Payment System BANK dan Sistem Keuangan Kampus, dimana kedua sistem tersebut terintegrasi dengan teknik WEB SERVICE, dalam kasus ini menggunakan SOAP WSDL. Sehingga ketika mahasiswa membayar uang kuliah melalui BANK, maka data transaksi pembayarannya juga sudah langsung tercatat di Sistem Keuangan Kampus.', 10, 2018, 2017, 115000, 'BOS', 0),
(2, 1, 1, 'BK-002', 'Politik Perempuan Indonesia Pasca Reformasi', 'Ani Soetjipto', 'Lokomedia', '20170803101937-cover_buku_ani.jpg', 'Politik Harapan: Perjalanan Politik Perempuan Indonesia Pasca-Reformasi. Gerakan politik perempuan Indonesia telah mencapai beberapa kemajuan penting, kuota bagi perempuan di kursi dewan salah satunya. Tetapi, apakah capaian kuantitatif cukup dijadikan dasar bagi keberhasilan sebuah gerakan perempuan di Indonesia secara menyeluruh? Tujuan transformasi politik bukanlah pekerjaan rumah yang mudah, susah-susah gampang. Tantangan feminisasi kemiskinan, struktur birokrasi dan institusi pembangunan di Indonesia yang masih dilekati oleh Ã¢â‚¬Å“watak patriarkiÃ¢â‚¬Â. ', 3, 2016, 2018, 67000, 'BOS', 0),
(5, 4, 6, 'SJR001', 'Bukan 350 Tahun Dijajah', 'GJ Resink', 'yudhistira', '20170926155411-cd04214d115e7a754daa198b57282145_M.jpg', 'Maka, pertanyaan besarnya adalah bagaimana gerakan perempuan Indonesia harus menyikapi kondisi secara politik? Pengamat politik senior Ani Soetjipto memaparkan temuan-temuan empiris serta pemikirannya tentang tantangan dan masa depan gerakan perempuan dalam konstelasi politik Indonesia terkini dalam sebuah buku. Diawali dengan tajuk Ã¢â‚¬Å“Politik HarapanÃ¢â‚¬Â tidak berlebihan rasanya di tengah arus menggila dan menggilas belakangan ini, para pembaca diberikan setitik cahaya. Optimisme.', 4, 2017, 2018, 98000, 'Sekolah', 0);
